import React from 'react';

function Menu() {
  return (
    <nav role="navigation" aria-label="Navigation Tab">
    <ul>
        <li><a href="/">Homepage</a></li>
        <li><a href="/about.html">About</a></li>
        <li><a href="/login.html">Login</a></li>
        <li><a href="https://google.com">Google</a></li>
    </ul>
</nav>
  );
}

export default Menu;
